(()=>{"use strict";const t=new class{constructor(t,n){this.title=t,this.logo=n}}("LunchApp","../img/plate.svg"),n=new class{constructor(t,n){this.copyright=t,this.credits=n}}("Copyright 2021","Developed by Sarah Falter");new class{constructor(){this.renderTemplate()}renderTemplate(){const e=`\n      <header>\n        <p>${t.title}</p>\n        <img src="${t.logo}" alt="" title="">\n      </header>\n      <main>\n      <section>\n        <h1>What's For Lunch?</h1>\n      </section>\n      </main>\n      <footer>\n        <p>${n.copyright}</p>\n        <p>${n.credits}</p>\n      </footer>\n    `;document.body.innerHTML=e}}})();